import React from 'react'

import Movie from '../Movie'


export default function ListOfMovies({ keyword }) {
  const [films, setFilms] = useState([]);

   
  return films.map( ({id, title, url}) => 
      <Movie
        key = {id}
        title = {title}
        image = {url}
      /> 
  )
}
